import BookAsset from './BookAsset';
const BookWithProgress = ({ chat, onSelectChat }) => {
    return (
        <li
            key={chat.chatId}
            className="
                min-w-80 max-w-96 mr-0 h-auto
                p-4
                flex-grow bg-gray-100 rounded-lg hover:bg-indigo-50 hover:cursor-pointer"
            onClick={() => onSelectChat(chat.chatId)}>
            <BookAsset
                key={chat.book.id}
                book={chat.book}
                onSelectBook={null}
            />
            <div>
                <div className="book-info">
                    <h1 className="font-m">{chat.book.title}</h1>
                    <h2 className="">{chat.book.author}</h2>
                </div>
                <ProgressBar></ProgressBar>

            </div>

        </li>
    );
};

export default BookWithProgress;
